import './App.css';
import Navbar from './Components/Navbar';
import Posts from './Components/Posts';
import Left from './Components/Left';
import Right from './Components/Right';
function App() {
  return (
       <div>
          <Navbar />
          <div className='page row row-cols-2'>
            <div className='cote'>
              <Left />
            </div>
            <div className='centre'>
              <Posts />
            </div>
          </div>
       </div>
  );
}

export default App;
